CREATE TABLE Consumo (
    id_registro INT PRIMARY KEY,
    id_cliente INT,
    id_servicio INT,
    fecha DATE,
    uso_mb INT,
    llamadas_minutos INT,
    fallos_reportados INT,
    FOREIGN KEY (id_cliente) REFERENCES dbo.Cliente(id_cliente),
    FOREIGN KEY (id_servicio) REFERENCES dbo.Servicio(id_servicio)
);

